pragma solidity >=0.5.0 <0.9.0;

contract enumsDemo{
    enum user {allowed,not_allowed}
    user public u1 = user.allowed;
    uint public lottery=10000;

    function check() public{
        if(u1==user.not_allowed){
            lottery=0;
        }  
    }

    function change() public{
        u1=user.not_allowed;
    }

}

